import React from 'react';
import GridImage from './GridImage'

const getImage = (item) => <GridImage item={item}></GridImage>
const VideoItem = ({thumb, title}) => {
    return <div className='button p-10 m-1 r-10 bg-black color-yellow'>
                <img src={thumb} />
                <div className='copyright'>{title}</div>
            </div>
};

export default VideoItem;
